import React, { Component } from 'react';
import './card.css';


class Card extends Component {
    constructor (props) {
        super(props)

        this.state = {
            memes: []
        }
    }

    componentDidMount () {
        fetch('https://randomuser.me/api')
            .then(res => res.json())
            .then(memesJson => this.setState({ memes: memesJson
                // const foto = data.results['0'].picture.large;
                // const nomb = data.results['0'].name.first;
                // console.log(data.results['0'])
                // console.log(foto)
                // console.log(nomb)
            }))
    }

    render() {

        function newUser() {
            componentDidMount ()
        }

        const nomb = 'adasdas'
        return (

            <div className="container">
                <div className="card">
                    <div className="sneaker">
                        <div className="circle"></div>
                        {/* <img src="./adidas.png" alt="adidas"> */}
                    </div>
                    <div className="info">
                        <h1>{nomb}</h1>
                        <h3>Info</h3>

                        <div className="purchase">
                            <button onClick={()=>{newUser()}}>Purchase</button>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Card;
